        method:'GET',

    })
    }
    render(){
        return(
            <div>
                <h2>Tela de editar perfil</h2>
                <br/>
                <div>
                    <form className="form">
                    <text>Editar Perfil</text>
                    <br/>
                        <label>
                            Especificação:
                            <input type="text" />
                        </label>
                        <br/>
                        <label>
                            Telefone:
                            <input type="text" />
                        </label>
                        <div>
                        
                        <Button buttonSize='btn--large' type="submit">Editar</Button>
                        </div>
                    </form>
                    
                </div>
            </div>
        )
    }

}
